import React from 'react'

function Header() {
    const styles = {
    paperContainer: {
        height: 136,
        backgroundImage: `url(${"https://64.media.tumblr.com/d96d6d4360f27da5c47221e68cdff36f/tumblr_olucp2SNGx1vsjcxvo1_r1_640.gifv"})`,
        backgroundRepeat  : 'no-repeat',
        backgroundPosition: 'center',
    }
};
    return (
        <div>
             <header style={styles.paperContainer}>
       <h1 >Star Wars</h1>
        <img src = "http://pngimg.com/uploads/starwars/starwars_PNG51.png" alt="Star Wars"/>

      </header>
        </div>
    )
}

export default Header
